import Card from "../UI/Card";

const LiveChatPopup = () => {
  return (
    <>
      <Card>
        <div>
          <div>
            <h2>Customer Support</h2>
          </div>
        </div>
      </Card>
    </>
  );
};

export default LiveChatPopup;
